body .ff-default .ff-el-form-control {
    border-left: none;
    border-right: none;
    border-top: none;
    border-radius: 0;
    padding-left: 0px;
    border-color: rgba(107, 114, 128, 1);
}
body .fluentform .ff-el-group {
    margin-bottom: 40px;
}
.fluentform #ff_195_post_content{
	display: block !important;
}
.fluentform #mceu_18{
	display: none;
}
.fluentform .ff-el-input--label.ff-el-is-required.asterisk-right label:after {
    margin-left: -2px;
}
body .fluentform .ff-el-group.ff_list_buttons .ff-el-form-check:last-child label>span {
    border: none;
}
.fluentform .ff-el-group.ff_list_buttons .ff-el-form-check label{
	 border-radius: 2px;
	 border: 1px solid #868686;
}
body .fluentform .ff-el-group.ff_list_buttons .ff-el-form-check label {
    margin-right: 20px;
}
body .fluentform .ff-el-input--label {
    margin-bottom: 25px;
}
body .fluentform .ff-el-group.ff_list_buttons .ff-el-form-check.ff_item_selected label>span {
    background-color: #000000;
}

